
DROP TABLE IF EXISTS `dict_area_info`;
CREATE TABLE `dict_area_info` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `area_name` varchar(200) NOT NULL COMMENT '地区名称',
  `parent_id` varchar(36) NOT NULL COMMENT '地区父ID',
  `parent_ids` varchar(2000) DEFAULT NULL,
  `area_sort` decimal(8,0) DEFAULT NULL COMMENT '排序',
  `area_deep` decimal(8,0) DEFAULT NULL COMMENT '地区深度',
  `dept_code` varchar(50) DEFAULT NULL,
  `create_by` varchar(36) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_by` varchar(36) DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `del_flag` char(1) DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_area_info_area_name` (`area_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='地区';



-- ----------------------------
-- Table structure for dict_status
-- ----------------------------
DROP TABLE IF EXISTS `dict_status`;
CREATE TABLE `dict_status` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `status_type` varchar(10) DEFAULT NULL COMMENT '父品质ID',
  `status_name` varchar(255) DEFAULT NULL COMMENT '名称',
  `status_code` varchar(255) DEFAULT NULL COMMENT '代码',
  `is_use` varchar(255) DEFAULT NULL COMMENT '1：可以 0：不可用',
  `createdate` varchar(255) DEFAULT NULL COMMENT '创建时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=69 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of dict_status
-- ----------------------------

-- ----------------------------
-- Table structure for dict_sysinfo
-- ----------------------------
DROP TABLE IF EXISTS `dict_sysinfo`;
CREATE TABLE `dict_sysinfo` (
  `id` varchar(36) NOT NULL COMMENT 'UUID',
  `data_value` varchar(200) DEFAULT NULL COMMENT '数据值',
  `tag_name` varchar(200) DEFAULT NULL COMMENT '标签名',
  `dict_type` varchar(30) DEFAULT NULL COMMENT '字典类型',
  `dict_desc` varchar(200) DEFAULT NULL COMMENT '字典描述',
  `sort_no` int(11) DEFAULT NULL COMMENT '排序',
  `parent_id` varchar(200) DEFAULT NULL COMMENT '父级编号',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_by` varchar(36) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(36) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记（0：正常；1：删除）',
  PRIMARY KEY (`id`),
  KEY `dict_sinfo_idx_data_value` (`data_value`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of dict_sysinfo
-- ----------------------------

-- ----------------------------
-- Table structure for msg_template
-- ----------------------------
DROP TABLE IF EXISTS `msg_template`;
CREATE TABLE `msg_template` (
  `id` varchar(36) NOT NULL COMMENT 'UUID',
  `templ_name` varchar(255) DEFAULT NULL COMMENT '模板名称',
  `templ_desc` varchar(255) DEFAULT NULL COMMENT '模板描述',
  `templ_code` varchar(255) DEFAULT NULL COMMENT '模板编号',
  `templ_type` varchar(255) DEFAULT NULL COMMENT '模板类型',
  `templ_context` varchar(2000) DEFAULT NULL COMMENT '模板内容',
  `templ_send_type` varchar(255) DEFAULT NULL COMMENT '发送方式',
  `is_use` char(1) DEFAULT NULL COMMENT '是否启用',
  `create_by` varchar(36) DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(36) DEFAULT NULL COMMENT '更新人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='消息模板';

-- ----------------------------
-- Records of msg_template
-- ----------------------------

-- ----------------------------
-- Table structure for region_info
-- ----------------------------
DROP TABLE IF EXISTS `region_info`;
CREATE TABLE `region_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'UUID',
  `region_name` varchar(200) DEFAULT NULL COMMENT '地区名称',
  `name` varchar(200) DEFAULT NULL COMMENT '名称',
  `parent_id` int(11) DEFAULT NULL COMMENT '父地区ID',
  `parent_ids` varchar(2000) DEFAULT NULL COMMENT '父节点级数',
  `area_name` varchar(200) DEFAULT NULL COMMENT '大区名称',
  `region_depth` varchar(200) DEFAULT NULL COMMENT '地区深度',
  `post_num` varchar(200) DEFAULT NULL COMMENT '邮政编号',
  `admin_num` varchar(200) DEFAULT NULL COMMENT '行政编号',
  `sort_no` int(11) DEFAULT NULL COMMENT '排序',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_by` varchar(36) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(36) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记（0：正常；1：删除）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=820001 DEFAULT CHARSET=utf8 COMMENT='地区信息';

-- ----------------------------
-- Records of region_info
-- ----------------------------


DROP TABLE IF EXISTS `system_message`;
CREATE TABLE `system_message` (
  `id` varchar(36) NOT NULL COMMENT 'UUID',
  `msg_title` varchar(200) DEFAULT NULL COMMENT '消息标题',
  `msg_type` varchar(30) DEFAULT NULL COMMENT '消息类型',
  `msg_content` varchar(2000) DEFAULT NULL COMMENT '消息内容',
  `msg_url` varchar(200) DEFAULT NULL COMMENT '链接URL',
  `send_person` varchar(200) DEFAULT NULL COMMENT '发送人',
  `receive_person` varchar(200) DEFAULT NULL COMMENT '接收人',
  `msg_date` datetime DEFAULT NULL COMMENT '消息时间',
  `status` varchar(12) DEFAULT NULL COMMENT '消息状态',
  `read_user` varchar(200) DEFAULT NULL COMMENT '已读会员',
  `del_user` varchar(200) DEFAULT NULL COMMENT '删除会员',
  `is_msg_multi` int(11) DEFAULT NULL COMMENT '消息是否多播( 0:否 1:是)',
  `msg_sys` varchar(200) DEFAULT NULL COMMENT '消息系统',
  `create_by` varchar(36) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(36) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记（0：正常；1：删除）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统消息';



DROP TABLE IF EXISTS `visit_address`;
CREATE TABLE `visit_address` (
  `id` varchar(36) NOT NULL COMMENT 'UUID',
  `visit_addr` varchar(200) DEFAULT NULL COMMENT '访问地址',
  `http_type` varchar(36) DEFAULT NULL COMMENT 'http请求类型',
  `reverse_agnc_addr` varchar(1000) DEFAULT NULL COMMENT '反向代理地址',
  `grpg_name` varchar(200) DEFAULT NULL COMMENT '分组名称',
  `is_release` int(11) DEFAULT NULL COMMENT '是否发布( 0:否 1:是)',
  `is_sign` tinyint(2) DEFAULT '0' COMMENT '是否验签',
  `is_auth` tinyint(2) DEFAULT '0' COMMENT '是否鉴权',
  `is_def_ver` tinyint(2) DEFAULT '1' COMMENT '是否默认版本',
  `is_add_user` tinyint(2) DEFAULT '0' COMMENT '是否添加用户信息',
  `is_add_ver` tinyint(2) DEFAULT '0' COMMENT '是否在url中添加版本信息',
  `is_logger` tinyint(2) DEFAULT '0',
  `log_level` int(11) DEFAULT '1' COMMENT '日志级别',
  `is_inner` tinyint(255) DEFAULT NULL COMMENT '是否内部调用',
  `ver_info` varchar(255) DEFAULT 'v1.0' COMMENT '版本',
  `real_address` varchar(255) DEFAULT NULL COMMENT '正式环境url前缀地址',
  `test_address` varchar(255) DEFAULT NULL COMMENT '测试环境url前缀地址',
  `com_address` varchar(255) DEFAULT NULL COMMENT '集成环境url前缀地址',
  `author` varchar(255) DEFAULT NULL COMMENT '负责人',
  `is_degrade` tinyint(2) DEFAULT '0' COMMENT '是否降级',
  `degrade_context` varchar(4000) DEFAULT '{''command'':''nullResp'',''sequenceID'':'''',''fingerprint'':'''',''body'':{},''status'':''901'',''msg'':''系统繁忙,请稍后再试'',''code'':null,''msgCode'':null}' COMMENT '降级后返回内容',
  `address_type` varchar(255) DEFAULT 'real' COMMENT '地址类型',
  `access_limit_type` varchar(36) DEFAULT '103310' COMMENT '限流类型',
  `access_limit_value` varchar(50) DEFAULT '1' COMMENT '控制值',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_by` varchar(36) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(36) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记（0：正常；1：删除）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='访问地址';



DROP TABLE IF EXISTS `visit_control`;
CREATE TABLE `visit_control` (
  `id` varchar(36) NOT NULL COMMENT 'UUID',
  `visit_ip` varchar(200) DEFAULT NULL COMMENT '访问IP',
  `is_limit` int(11) DEFAULT NULL COMMENT '是否限制',
  `limit_time` datetime DEFAULT NULL COMMENT '限制时间长度，秒',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_by` varchar(36) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(36) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记（0：正常；1：删除）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='访问控制';


DROP TABLE IF EXISTS `visit_log`;
CREATE TABLE `visit_log` (
  `id` varchar(36) NOT NULL COMMENT 'UUID',
  `visit_addr` varchar(200) DEFAULT NULL COMMENT '访问地址',
  `addr_code` varchar(255) DEFAULT NULL COMMENT '地址编码',
  `visit_ip` varchar(100) DEFAULT NULL COMMENT '访问IP',
  `visit_user_id` varchar(36) DEFAULT NULL COMMENT '访问用户',
  `visit_user_name` varchar(100) DEFAULT NULL COMMENT '用户名称',
  `visit_time` datetime DEFAULT NULL COMMENT '访问时间',
  `visit_context` varchar(1000) DEFAULT NULL COMMENT '访问内容',
  `visit_client` varchar(1000) DEFAULT NULL COMMENT '访问客户端',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_by` varchar(36) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(36) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记（0：正常；1：删除）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='访问日志';


DROP TABLE IF EXISTS `sys_dict`;
CREATE TABLE `sys_dict` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `value` varchar(100) NOT NULL COMMENT '数据值',
  `label` varchar(100) NOT NULL COMMENT '标签名',
  `type` varchar(100) NOT NULL COMMENT '类型',
  `description` varchar(100) NOT NULL COMMENT '描述',
  `sort` decimal(10,0) NOT NULL COMMENT '排序（升序）',
  `parent_id` varchar(64) DEFAULT '0' COMMENT '父级编号',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`id`),
  KEY `sys_dict_value` (`value`),
  KEY `sys_dict_label` (`label`),
  KEY `sys_dict_del_flag` (`del_flag`),
  KEY `sys_dict_idx_val_type` (`value`,`type`),
  KEY `sys_dict_idx_type` (`type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='字典表';


